import Note from './components/Note.js'

const App = ({ notes }) => {
  return (
    <div>
      <h1>Notes</h1>
      <ul>
        {notes.map(note =>  <Note key = {notes.id} note={note} />) }
      </ul>
    </div>
  )
}

export default App;
